export default `
    query(
        $nickname: String!
    ){
        profile(nickname: $nickname){
            user{
                id,
                nickname
                picture
                sub 
            }
            description
            records
            recordsTime
            generes {
                occurrence
                genere {
                    name
                }
            }
        }
    }
        
`
